import './App.css';
import React,{useState} from "react";
import ReactTooltip from "react-tooltip";
import{
  ComposableMap,
  Geographies,
  Geography,
  Marker,Annotation,
  ZoomableGroup,
} from "react-simple-maps";


function App() {
  return (
    <div className="App" style={{
      width:"100%",
      height:"100%",
      display:"flex",
      flexDirection:"column",
      justifyContent:"center",
      alignItems:"center",
    }}>
     Map UI
    </div>
  );
}

export default App;
